import { Swiper, SwiperSlide } from 'swiper/react';

function Skip(){
    return(
    <div className='skip' id="skip">
        <a href="#mainVisual">메인비주얼</a>
        <a href="#VideoSlide">취업코칭 비디오</a>
        <a href="#CoachSlide">취업코칭 사례</a>
        <a href="#ServiceIntro">온라인 취업코칭 활용방법</a>
    </div>
    )
}

export {Skip}
